Prepišite naslednjo kodo, ki jo dokumentira:

zasebno asinhrono opravilo SetAndGetKeysPipelineBacth(int količina, StringDTO testStringDTO)
{
var salt = Guid.NewGuid().ToString();
var štoparica = nova štoparica();
štoparica.Start();
var batch = _db.CreateBatch();
var tasks = new List<Task>();
za (int i = 1; i <= količina; i++)
{
var instructorNameKey = new RedisKey($"instructors:{salt}_{i}:name");
tasks.Add(batch.StringSetAsync(instructorNameKey, $"Ime inštruktorja {salt}_{i}"));
tasks.Add(batch.StringGetAsync(instructorNameKey)
.ContinueWith(x => testStringDTO.Instructors.Add($"{x.Result}")));
}

batch.Execute();
čakaj Task.WhenAll(tasks);
štoparica.Stop();
testStringDTO.TimeSeconds = štoparica.Elapsed.TotalSeconds.ToString(CultureInfo.InvariantCulture);
}

Razčlenite to kodo C++ in razložite, kaj počne:

```
#include "Graphics.h"

#include "Texture.h"
#include "Camera.h"

#define SET_COLOR() SDL_SetRenderDrawColor(handle, color.r, color.g, color.b, color.a)

#define CAM Camera::getActive()
#define CAM_POS CAM->position

void Graphics::drawLine(const Vec2 &from, const Vec2 &to, const Color &color) {
    SET_COLOR();
    Vec2 f = from - CAM_POS;
    SDL_RenderDrawLineF(handle, f.x, f.y, to.x, to.y);
}

void Graphics::drawLine(const Vec2 &origin, const Vec2 &direction,
                        const Vec2 &length, const Color &color) {
    drawLine(origin, origin + direction * length, color);
}

void Graphics::drawPoint(const Vec2 &position, const Color &color) {
    SET_COLOR();
    Vec2 p = position - CAM_POS;
    SDL_RenderDrawPointF(handle, position.x, position.y);
}

void Graphics::drawRect(const Rect &rect, const Color &color) {
    SET_COLOR();
    SDL_FRect r = rect;
    r.x -= CAM_POS.x;
    r.y -= CAM_POS.y;
    SDL_RenderDrawRectF(handle, &r);
}

void Graphics::fillRect(const Rect &rect, const Color &color) {
    SET_COLOR();
    SDL_FRect r = rect;
    r.x -= CAM_POS.x;
    r.y -= CAM_POS.y;
    SDL_RenderFillRectF(handle, &r);
}
```

